//import logo from './logo.svg';
import './ExternalStylesheet.css';
import Song from './Song';
import Podcast from './Podcast';

export default function Playlist() {
  return (
      <div>


        <Song
          songtitle='Reptile'
          artist= 'Periphery'
          year={2019}
        />
        <Song
          songtitle='Garden in the Bones'
          artist= 'Periphery'
          year={2019}
        />
        <Song
          songtitle='Its Only Smiles'
          artist= 'Periphery'
          year={2019}
        />

        <Podcast
          season='1'
          episode= {28}
          episodeTitle='Blake Norris, PJ Ladd | Nine Club Live #28'
        />
        <Podcast
          season=' '
          episode= {29}
          episodeTitle='Guy Mariano, Louie Lopez, Davonte Jolly | Nine Club Live #29'
        />
        <Podcast
          season=' '
          episode= {30}
          episodeTitle='Most Influential Skate Videos Of All Time, Habitat XXIV | Nine Club Live #30'
        />

      </div>
    );
}
